            loss_2018 = item['number_value']
        elif item['category'] == 'Opereating loss carryforward' and item['header2'] == '2019':
            loss_2019 = item['number_value']

    if loss_2018 is not None and loss_2019 is not None:
        if loss_2018 == 0:
            if loss_2019 == 0:
                percentage_change = 0.00
            else:
                percentage_change = float('inf')
        else:
            percentage_change = ((loss_2019 - loss_2018) / loss_2018) * 100
